import Input from "@mui/joy/Input";
import styled from "@emotion/styled";
import FormLabel from "@mui/joy/FormLabel";


const Container = styled.div`
  display: flex;
`;

const IndividualExpenseRow = () => {
    <Container>
        <div>
          <FormLabel>Person 1</FormLabel>
          <Input placeholder="Name" variant="outlined" />
        </div>
        <div>
          <FormLabel>Individual Amount</FormLabel>
          <Input placeholder="Amount" variant="outlined" />
        </div>
      </Container>
}

export default IndividualExpenseRow;
